import React from "react";

function About() {
  return (
    <div class="about">
      <h1>about myself</h1>
      <p>
      I'm a Web Developer with a passion for beautiful design and creating
          great user experiences. My goals include fast load times, responsive
          layouts, and lag free interaction, creating non-static websites that
          can come to life.
      </p>
      <h3>my skills include</h3>
      <ul>
        <li>HTML, CSS, JS: Vanilla/JQuery/Node.Js/REACT, API's, MongoDB, MySQL</li>
        <li>Problem Solving, Adaptability, Quick Learning, Team Player</li>
        <li>Fluent in English and Spanish</li>
      </ul>

    </div>
  );
}

export default About;
